function findKthLargest(nums: number[], k: number): number {
  let ans = 0;
  const flag = nums.length - k;
  // console.log('flag:', flag);
  // 用快排找到第k个数，然后返回
  const help = (left: number, right: number) => {
    // console.log('left:', left)
    // console.log('right:', right)
    let pivot = nums[left];
    // console.log('pivot:', pivot);
    let l = left - 1;
    let r = right + 1;
    while (l < r) {
      do {
        l++;
      }
      while (pivot > nums[l])
      do {
        r--;
      }
      while (pivot < nums[r])

      if (l < r) {
        // console.log('swap', l, r, nums[l], nums[r]);
        [nums[l], nums[r]] = [nums[r], nums[l]]
      }
    }
    if (l === flag) {
      ans = pivot;
      console.log(nums)
      return
    } else if (l < flag) {
      help(l + 1, right);
    } else {
      help(left, l - 1);
    }
  }
  help(0, nums.length - 1)

  return ans;
};

function findKthLargest1(nums: number[], k: number): number {
  let ans = 0;
  const flag = nums.length - k;
  // 用快排找到第k个数，然后返回
  const help = (left: number, right: number) => {
    console.log('left:', left);
    console.log('right:', right);
    if (left === right) {
      ans = nums[flag]
      return
    }
    let pivot = nums[left];
    console.log('pivot:', pivot);
    let l = left - 1;
    let r = right + 1;

    while (l < r) {
      console.log('while:', nums);
      do {
        console.log('l++', l)
        l++;
      }
      while (nums[l] < pivot)
      do {
        console.log('r--', r)
        r--;
      }
      while (nums[r] > pivot)

      console.log('l:', l, 'r:', r);
      if (l < r) {
        console.log('swap');
        [nums[l], nums[r]] = [nums[r], nums[l]]
      }
    }

    console.log(l, left);
    // if (l !== left) {
    //   console.log('swap');
    //   [nums[l], nums[left]] = [nums[left], nums[l]]
    // }
    console.log('help:', nums, flag <= r)
    if (flag <= r) {
      help(left, r)
    } else {
      help(r + 1, right)
    }
  }
  help(0, nums.length - 1)

  return ans;
};

// 堆排序实现
function findKthLargest2(nums: number[], k: number): number {
  const heap: number[] = [];
  const n = nums.length;
  // 初始化一个k大的数组
  for (let i = 0; i < k; i++) {
    heap.push(nums[i]);
  }

  const parent = (child: number) => Math.floor((child - 1) / 2)

  const siftDown = (i: number) => {
    let p = i;
    while (true) {
      let maxPos = p;
      const left = p * 2 + 1;
      if (left < k && heap[maxPos] > heap[left]) {
        maxPos = left;
      }

      const right = p * 2 + 2;
      if (right < k && heap[maxPos] > heap[right]) {
        maxPos = right;
      }
      if (maxPos !== p) {
        [heap[p], heap[maxPos]] = [heap[maxPos], heap[p]]
        p = maxPos;
      } else {
        break;
      }
    }
  }

  for (let i = parent(k - 1); i >= 0; i--) {
    siftDown(i)
  }

  for (let i = k; i < n; i++) {
    if (heap[0] < nums[i]) {
      heap[0] = nums[i];
      siftDown(0)
    }
  }
  return heap[0];
}




